import "./ExpenseItem.css";

const ExpenseItem = (props) => {
  return (
    <div>
      <h1 class="travel">
        {props.title}
        <br>{props.price}</br>
        <br>{props.days}</br>
        <br>{props.persons}</br>
        <br>{props.name1}</br>
        <br>{props.hotelname}</br>
        <br>{props.travelhours}</br>
      <br>{props.date.toISOString()}</br>
      <br>props.</br>
      </h1>
    </div>
  );
};
export default ExpenseItem;
